function Tabla(props) {
  return (
    <table>
      <thead>
        <tr>
          <th>Nombre</th>
          <th>Apellido</th>
          <th>Edad</th>
        </tr>
      </thead>
      <tbody>
        {props.data.map((simulacion) => (
          <tr>
            <td>{simulacion.nombre}</td>
            <td>{simulacion.apellido}</td>
            <td>{simulacion.edad}</td>
          </tr>
        ))}
      </tbody>
    </table>
  );
}

export default Tabla;
